    <li>
        Explanation
        <div>
            <p>
                You should use the following command:
            </p>
            <p>
                $vmRg = 'prod'
                <br />
                $vm = ""vm1""
                <br />
                $path = ""config.xml""
                <br />
                Set-AzureRmVMDiagnosticsExtension -ResourceGroupName $vmRg  `
                <br />
                -VMName $vm -DiagnosticsConfigurationPath $path
            </p>
            <p>
                To enable guest OS diagnostics for an Azure VM by using Azure PowerShell, you should use the Set-AzureRmVMDiagnosticsExtension command. This command enables Azure to retrieve diagnostics telemetry data from Performance Monitor and Event Logs and display them in a variety of ways, including through an Azure Log Analytics workspace.
            </p>
            <p>
               ");
            WriteLiteral(@" You should use the DiagnosticsConfigurationPath parameter because you need to pass an Extensible Markup Language (XML) format configuration file to Set-AzureRmVMDiagnosticsExtension so Azure understands which guest OS diagnostics to enable on the target VM or VMs.
            </p>
            <p>
                You should not use the Set-AzureRmDiagnosticSetting command. This command only enables you to make modifications to a VM that is already enabled for guest OS diagnostics data collection.
            </p>
            <p>
                You should not use the Set-AzureRMBootdiagnostics command. This command enables only boot diagnostics and not guest-level diagnostics. Boot diagnostics takes periodic screen captures of the VM's desktop or terminal screen to give administrators a fast way to determine the VM's runtime state.
            </p>
        </div>
    </li>
    <li>
        References
        <div>
            <p>
                <a href=""https://docs.microsoft.com/en-us/azure/vi");
            WriteLiteral(@"rtual-machines/extensions/diagnostics-windows"" target=""_blank"" rel=""noopener"">Use PowerShell to enable Azure Diagnostics in a virtual machine running Windows</a>
            </p>
            <p>
                <a href=""https://docs.microsoft.com/en-us/powershell/module/azurerm.compute/set-azurermvmdiagnosticsextension"" target=""_blank"" rel=""noopener"">Set-AzureRmVMDiagnosticsExtension</a>
            </p>
            <p>
                <a href=""https://docs.microsoft.com/en-us/powershell/module/azurerm.insights/set-azurermdiagnosticsetting"" target=""_blank"" rel=""noopener"">Set-AzureRmDiagnosticSetting</a>
            </p>
        </div>
    </li>
</ul>");
